import React from "react";
import catHeader from "../../images/cat-header.jpg";

const Navbar = () => {
  return (
    < >

     <img src={catHeader} alt="Cat Header " className="brightness-20% brightness-50 w-1920 h-727 object-cover" />
     
      <h1 className="text-3xl font-bold bg-orange-300 ">CatLy</h1>
      <ul>
        <li>Home</li>
        <li>About Us</li>
        <li>Contact</li>
      </ul>
    </>
  );
};

export default Navbar;
